  return (
    <div>
      {LinlList.map(cat =>(
        <div key={cat.Category}>
        <h2>{cat.Category}</h2>
          <ul>
            {cat.items.map( sub => (
              <li><Link to = '/' key= {sub.sub}>{sub.sub} </Link> </li>

            ))}
          </ul>
        </div>
      ))}


    </div>
  );
}
